import React from "react";
import './LoginSignup.css';
import user_icon from '../Icons/user_icon.svg';

const LoginSignup = () => {
    return (
        <div class='wrapper'>
            <div class='header'>
                <div class="text">Sign Up</div>
            </div>
        </div>
    )
}

export default LoginSignup
